import React from "react";
import { RestaurantList } from "../pages/Res";
import Layout from "./../components/Layout/Layout";

import "../styles/Login.css";
import {
  Box,
  Card,
  CardActionArea,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";

const Menu = () => {
  return (
    <Layout>
      
        {RestaurantList.map((menu) => (
       
             <CardActionArea>
              <CardMedia
                sx={{ minHeight: "400px" }}
                component={"img"}
                src={menu.image}
                alt={menu.name}
              />
              <CardContent>
                <Typography variant="h5" gutterBottom component={"div"}>
                  {menu.name}
                </Typography>
                <Typography variant="body2">{menu.description}</Typography>
              </CardContent>
              <div className="Card-button">
                 <button className="btn btn-primary button-set" type="submit">Login</button>
              </div>
          
             </CardActionArea>
          
          
        ))},
          
         
        
  
    </Layout>
  );
};

export default Menu;
